function movement() 
    inputdy = 0
    inputdx = 0
    if btnp(0) and 1 == mget(((p.px+4) // 8), (p.py // 8) + 2) then p.dy = p.dy - 5 end
    if btnp(1) then inputdy = inputdy + 1 end
    if btn(2) then 
        inputdx = inputdx - 1
        p.facing = 1 
    end
    if btn(3) then 
        inputdx = inputdx + 1
        p.facing = 0 
    
    end

    p.dx = inputdx
end

